global $sap_db_version;
$sap_db_version = '1.0';

// this shows the table for benef
function sap_view(){
	require_once MY_PLUGIN_DIR . 'public/partials/sap-bene-viewer-table.php';
}
add_shortcode('views','sap_view');

function sap_benef_install() {
	global $wpdb;
	global $sap_db_version;

	$sap_benef_info_table_name = $wpdb->prefix . 'fo2_sapbenefs';
	$sap_location_table_name = $wpdb->prefix . 'fo2_saplocations';
	
	$charset_collate = $wpdb->get_charset_collate();

	$sql_array = array();

	require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );

	if ($wpdb->get_var("SHOW TABLES LIKE '" . $sap_benef_info_table_name . "'") !== $sap_benef_info_table_name) {
		$sql_array_one = "CREATE TABLE $sap_benef_info_table_name (
			beneid int(11) NOT NULL AUTO_INCREMENT,
			last_name varchar(150) NOT NULL,
			first_name varchar(150) NOT NULL,
			middle_name varchar(150) NOT NULL,
			ext_name varchar(150) NOT NULL,
			brgy_code varchar(13) NOT NULL,
			PRIMARY KEY  (beneid)
		) $charset_collate;";	
		dbDelta($sql_array_one);
	}

	if ($wpdb->get_var("SHOW TABLES LIKE '" . $sap_location_table_name . "'") !== $sap_location_table_name) {
		$sql_array_two = "CREATE TABLE $sap_location_table_name (
			locid int(11) NOT NULL AUTO_INCREMENT,
			province varchar(150) NOT NULL,
			city_municipality varchar(150) NOT NULL,
			barangay varchar(150) NOT NULL,
			psgc_barangay varchar(150) NOT NULL,
			PRIMARY KEY  (locid)
		) $charset_collate;";
		dbDelta($sql_array_two);
	}
		update_option( 'sap_db_version', $sap_db_version );
}

