function public_assets_init() {
	wp_enqueue_script('jquery');
	wp_register_script('public-js',plugins_url('sap-bene-viewer/public/js/sap-bene-viewer-public.js'));
    $script_data_array = array(
    	'ajaxurl' => admin_url('admin-ajax.php'),
    	'security' => wp_create_nonce('load_areas'),
    	'pluginsUrl' => plugins_url(),
    );
    wp_localize_script('public-js','sap_bene_viewer',$script_data_array);
    wp_enqueue_script('public-js', plugins_url('sap-bene-viewer/public/js/sap-bene-viewer-public.js'));
	wp_register_script( 'jquery3.2.1', 'https://code.jquery.com/jquery-3.2.1.min.js' );
	wp_add_inline_script( 'jquery3.2.1', 'var jQuery3_2_1 = $.noConflict(true);' );
	wp_enqueue_script( 'plugin-javascript', plugins_url( 'sap-bene-viewer/public/js/jquery-3.2.1.min.js'), array( 'jquery3.2.1' ) );    
    wp_enqueue_style('public-css', plugins_url('sap-bene-viewer/public/css/sap-bene-viewer-public.css'));
}

add_action('wp_enqueue_scripts','public_assets_init');

function get_municipality_by_ajax_callback() {
	check_ajax_referer('load_areas','security');
	$province = trim(strtoupper($_POST['province']));
	global $wpdb;
	$sap_location_table_name = $wpdb->prefix . 'fo2_saplocations';	
	$aMunicipality = $wpdb->get_results($wpdb->prepare("SELECT DISTINCT city_municipality FROM {$sap_location_table_name} WHERE province = %s",$province));
	if ($aMunicipality) {
		echo '<select name="municipality" id="municipality">';
			foreach ($aMunicipality as $municipality) {
				$municipality_name = $municipality->city_municipality;
				echo "<option value='{$municipality_name}'>{$municipality_name}</option>";
			}
		echo '</select>';
	}

	wp_die();
}

function get_barangay_by_ajax_callback() {
	check_ajax_referer('load_areas','security');
	$province = trim(strtoupper($_POST['province']));
	$municipality = trim(strtoupper($_POST['municipality']));
	global $wpdb;
	$sap_location_table_name = $wpdb->prefix . 'fo2_saplocations';		
	$aBarangay = $wpdb->get_results($wpdb->prepare("SELECT barangay FROM {$sap_location_table_name} WHERE province = %s AND city_municipality = %s",array($province,$municipality)));
	if ($aBarangay) {
		echo '<select name="barangay" id="barangay">';
			foreach ($aBarangay as $barangay) {
				$barangay_name = $barangay->barangay;
				echo "<option value='{$barangay_name}'>{$barangay_name}</option>";
			}
		echo '</select>';
	}
	wp_die();
}

function get_results_by_ajax_callback() {
	check_ajax_referer('load_areas','security');
	$province = trim(strtoupper($_POST['province']));
	$municipality = trim(strtoupper($_POST['municipality']));	
	$barangay = trim(strtoupper($_POST['barangay']));	
	global $wpdb;
	$sap_benef_info_table_name = $wpdb->prefix . 'fo2_sapbenefs';
	$sap_location_table_name = $wpdb->prefix . 'fo2_saplocations';		
	if (isset($_POST['province']) && $_POST['province'] != '--Select Province--') {
		$province = trim(strtoupper($_POST['province']));
		$search .= 'location.province = '."'{$province}'";
	}
	if (isset($_POST['municipality']) && $_POST['municipality'] != '--Select Municipality--') {
		$municipality = trim(strtoupper($_POST['municipality']));
		$search .= ' AND location.city_municipality = '."'{$municipality}'";
	}
	if (isset($_POST['barangay']) && $_POST['barangay'] != '--Select Barangay--') {
		$barangay = trim(strtoupper($_POST['barangay']));
		$search .= ' AND location.barangay = '."'{$barangay}'";
	}
	$results = $wpdb->get_results("SELECT first_name,ext_name,middle_name,last_name FROM {$sap_benef_info_table_name} as benef INNER JOIN {$sap_location_table_name} as location ON benef.brgy_code = location.psgc_barangay WHERE $search");

	// pagination
	$customPagHTML     = "";
	$query             = "SELECT * FROM FROM {$sap_benef_info_table_name} as benef INNER JOIN {$sap_location_table_name} as location ON benef.brgy_code = location.psgc_barangay WHERE $search";
	$total_query     = "SELECT COUNT(beneid) FROM ({$query}) AS combined_table";
	$total             = $wpdb->get_var( $total_query );
	$items_per_page = 4;
	$page             = isset( $_GET['cpage'] ) ? abs( (int) $_GET['cpage'] ) : 1;
	$offset         = ( $page * $items_per_page ) - $items_per_page;
	$result         = $wpdb->get_results( $query . " ORDER BY field DESC LIMIT ${offset}, ${items_per_page}" );
	$totalPage         = ceil($total / $items_per_page);

	print sql
	echo $wpdb->last_query;	

	if ($results) {
		echo '<input type="text" name="search" id="searchsaptextbox" placeholder="Enter Seach Keyword"/><table id="sap_bene_results_table">
				<thead><tr>
					<th>First Name</th>
					<th>Middle Name</th>
					<th>Last Name</th>
				</tr></thead><tbody id="fbody">';
					foreach( $results as $benef_data) {
						echo "<tr>
							<td>$benef_data->first_name $benef_data->ext_name</td>
							<td>$benef_data->middle_name</td>
							<td>$benef_data->last_name</td>
						</tr>";
					}
		echo '</tbody></table></form>';
	} else {
		echo '<h5 style="text-align:center;">No Data for this Barangay</h5>';
	}	

	if($totalPage > 1){
		$customPagHTML     =  '<div><span>Page '.$page.' of '.$totalPage.'</span>'.paginate_links( array(
		'base' => add_query_arg( 'cpage', '%#%' ),
		'format' => '',
		'prev_text' => __('&laquo;'),
		'next_text' => __('&raquo;'),
		'total' => $totalPage,
		'current' => $page
		)).'</div>';
	}		
	wp_die();	
}

