function sap_benef_plugin_delete() {
	global $wpdb;
	$tablearray = [
		$wpdb->prefix . 'fo2_sapbenefs',
		$wpdb->prefix . 'fo2_saplocations',
	];

	foreach ($tablearray as $tablename){
		$wpdb->query("DROP TABLE IF EXISTS $tablename");
	}

	delete_option('sap_benef_version');
}
